import React, { useState, useEffect } from 'react';

const Gallery = () => {
	const [items, setItems] = useState(10);
	const [loading, setLoading] = useState(false);

	const showItems = () => {
    var items = [];
    for (var i = 0; i < this.state.items; i++) {
      items.push(<li key={i}>Item {i}</li>);
    }
    return items;
	};

	

	return (
		<div>
			Gallery
			<ul>
				{this.showItems()}
			</ul>
		</div>
	);

};

export default Gallery;
